export default function PlannerForm({
  startMode,
  setStartMode,
  startInput,
  setStartInput,
  selectedPlaces,
  setSelectedPlaces,
  weights,
  setWeights,
  onGenerate,
  isLoading,
}) {
  const addMockPlace = () => {
    const next = {
      id: crypto.randomUUID(),
      name: `관광지 ${selectedPlaces.length + 1}`,
      lat: 37.5665 + Math.random() * 0.02,
      lng: 126.978 + Math.random() * 0.02,
    };
    setSelectedPlaces([...selectedPlaces, next]);
  };

  const removePlace = (id) => {
    setSelectedPlaces(selectedPlaces.filter((p) => p.id !== id));
  };

  const updateWeight = (key, value) => {
    setWeights({ ...weights, [key]: value });
  };

  return (
    <div style={{ display: "grid", gap: 12 }}>
      <h2 style={{ margin: 0 }}>입력</h2>

      {/* 출발지 모드 */}
      <div style={{ display: "grid", gap: 6 }}>
        <div style={{ fontWeight: 600 }}>출발지</div>
        <div style={{ display: "flex", gap: 8, flexWrap: "wrap" }}>
          <button
            onClick={() => setStartMode("current")}
            style={{
              border: "1px solid #ddd",
              borderRadius: 8,
              padding: "8px 10px",
              background: startMode === "current" ? "#f3f3f3" : "white",
            }}
          >
            현재 위치
          </button>
          <button
            onClick={() => setStartMode("custom")}
            style={{
              border: "1px solid #ddd",
              borderRadius: 8,
              padding: "8px 10px",
              background: startMode === "custom" ? "#f3f3f3" : "white",
            }}
          >
            지정 위치
          </button>
        </div>

        {startMode === "custom" && (
          <input
            value={startInput}
            onChange={(e) => setStartInput(e.target.value)}
            placeholder="주소 또는 (위도,경도) 입력"
            style={{
              border: "1px solid #ddd",
              borderRadius: 8,
              padding: 10,
            }}
          />
        )}
      </div>

      {/* 관광지 선택(지금은 mock 추가 버튼) */}
      <div style={{ display: "grid", gap: 6 }}>
        <div style={{ fontWeight: 600 }}>관광지</div>

        <div style={{ display: "flex", gap: 8, flexWrap: "wrap" }}>
          <button
            onClick={addMockPlace}
            style={{
              border: "1px solid #ddd",
              borderRadius: 8,
              padding: "8px 10px",
              background: "white",
            }}
          >
            관광지 추가(임시)
          </button>
        </div>

        {selectedPlaces.length > 0 && (
          <div style={{ display: "flex", gap: 8, flexWrap: "wrap" }}>
            {selectedPlaces.map((p) => (
              <span
                key={p.id}
                style={{
                  border: "1px solid #ddd",
                  borderRadius: 999,
                  padding: "6px 10px",
                  display: "inline-flex",
                  alignItems: "center",
                  gap: 8,
                }}
              >
                {p.name}
                <button
                  onClick={() => removePlace(p.id)}
                  style={{
                    border: "none",
                    background: "transparent",
                    cursor: "pointer",
                    fontWeight: 700,
                  }}
                  aria-label="remove"
                >
                  ×
                </button>
              </span>
            ))}
          </div>
        )}
      </div>

      {/* 가중치(임시 슬라이더) */}
      <div style={{ display: "grid", gap: 8 }}>
        <div style={{ fontWeight: 600 }}>가중치(임시)</div>

        {["scenery", "crowd", "cost"].map((key) => (
          <label key={key} style={{ display: "grid", gap: 4 }}>
            <div style={{ display: "flex", justifyContent: "space-between" }}>
              <span>{key}</span>
              <span>{weights[key]}</span>
            </div>
            <input
              type="range"
              min="0"
              max="10"
              value={weights[key]}
              onChange={(e) => updateWeight(key, Number(e.target.value))}
            />
          </label>
        ))}
      </div>

      <button
        onClick={onGenerate}
        disabled={isLoading || selectedPlaces.length === 0}
        style={{
          marginTop: 6,
          border: "1px solid #ddd",
          borderRadius: 10,
          padding: "10px 12px",
          background: isLoading ? "#f3f3f3" : "white",
          cursor: isLoading ? "not-allowed" : "pointer",
          fontWeight: 600,
        }}
      >
        {isLoading ? "경로 생성 중..." : "경로 생성"}
      </button>

      <div style={{ fontSize: 12, color: "#666" }}>
        * 지금은 관광지 검색 대신 “관광지 추가(임시)”로 테스트하고,
        나중에 PlaceSearch로 교체하면 돼.
      </div>
    </div>
  );
}
